import React, { Fragment } from 'react';

function App() {
  return (
    <Fragment>
      <div className="App">
        <h3>This is React App.</h3>
      </div>
      <div className="App">
        <h3>This is React App-two.</h3>
      </div>
    </Fragment>
  );
}

export default App;
